export function arrowFunctions() {
    function withACallBack(options, callback) {
        callback(options)
    }

    withACallBack('so long', function (options) {
        return options
    })

    withACallBack('A Little Shorter', (options) => {
        return options
    })

    withACallBack('very short', options=>options)
}
